class Simples:    def _init_(self,n,cpf,c,r):        self.n = n        self.cpf = cpf        self.c = c        self.r = r            def setn (self, n):        self.n = n            def setCPF (self, cpf):        self.cpf = cpf            def setc (self, c):        self.c = c        def setr (self, r):        self.r = r        def getn (self):        return self.n        def getCPF (self):        return self.cpf        def getc (self):        return self.c        def getr (self):        return self.rclass Completo (Simples):        def _init_(self,n,cpf,i,d,c,r):        super()._init_(n,cpf,c,r)        self.i = i        self.d = d            def setI (self,i):        self.i = i                def setD (self,d):        self.d = d            def getI (self):        return self.i            def getD (self):        return self.d